import React from "react";

const Menu = (props)=>{   
    console.log(props);   
    const stl = {
        "backgroundColor":"rgb(80,211,255)"
    } 
        return(
            <div className=" screen_div menu">
                <h2>Ipod</h2>
                if(props.item==1){
                <div className=" music" style={{"backgroundColor":"rgb(80, 211, 255)"}} >
                    <div>
                        Music
                    </div>
                    <div className=" disable active ">
                    <i className ="fas fa-greater-than"></i>
                    </div>
                </div>
                }else{
                    <div className=" music" >
                    <div>
                        Music
                    </div>
                </div>
                }
                if(props.item==2){
                <div className=" music" style={{"backgroundColor":"rgb(80, 211, 255)"}} >
                    <div>
                        CoverFlow
                    </div>
                    <div className=" disable active ">
                    <i className ="fas fa-greater-than"></i>
                    </div>
                </div>
                }else{
                    <div className=" music" >
                    <div>
                        Music
                    </div>
                </div>
                }
                if(props.item==2){
                <div className=" music" style={{"backgroundColor":"rgb(80, 211, 255)"}} >
                    <div>
                        Setting
                    </div>
                    <div className=" disable active ">
                    <i className ="fas fa-greater-than"></i>
                    </div>
                </div>
                }else{
                    <div className=" music" >
                    <div>
                        Music
                    </div>
                </div>
                }
                
                <div className="music">
                    Setting
                </div>
                <div className="music">
                    Games
                </div>
            </div>
        )
}

export default Menu;
